import wx
import wx.svg
import base64
from enum import Enum
from io import BytesIO

from utils.config import Config

class IconType(Enum):
    APP_ICON_DEFAULT = 1
    APP_ICON_SMALL = 2

    RESUME_ICON = 10
    PAUSE_ICON = 11
    DELETE_ICON = 12
    FOLDER_ICON = 13
    RETRY_ICON = 14
    REFRESH_ICON = 15
    SETTING_ICON = 16
    LIST_ICON = 17
    INFO_ICON = 18
    LOADING_ICON = 19

class IconManager:
    def __init__(self, window: wx.Window):
        self.window, self.DPI_scale_factor = window, window.GetDPIScaleFactor()

        if Config.Sys.dark_mode:
            self.dark_mode = True
        else:
            self.dark_mode = False

        match Config.Sys.platform:
            case "windows":
                self.DPI_factor_1 = 1
                self.DPI_factor_1_5 = 1.5
                self.DPI_factor_2 = 2

            case "linux" | "darwin":
                self.DPI_factor_1 = 1.5
                self.DPI_factor_1_5 = 2
                self.DPI_factor_2 = 3

    def get_icon_bitmap(self, icon_id: int):
        match icon_id:
            case IconType.APP_ICON_DEFAULT:
                return self._assets_app_icon_default

            case IconType.APP_ICON_SMALL:
                return self._assets_app_icon_small

            case IconType.RESUME_ICON:
                base64_string = self._assets_resume_icon

            case IconType.PAUSE_ICON:
                base64_string = self._assets_pause_icon

            case IconType.DELETE_ICON:
                base64_string = self._assets_delete_icon

            case IconType.FOLDER_ICON:
                base64_string = self._assets_folder_icon

            case IconType.RETRY_ICON:
                base64_string = self._assets_retry_icon

            case IconType.REFRESH_ICON:
                base64_string = self._assets_refresh_icon

            case IconType.SETTING_ICON:
                base64_string = self._assets_setting_icon

            case IconType.LIST_ICON:
                base64_string = self._assets_list_icon

            case IconType.INFO_ICON:
                base64_string = self._assets_info_icon
            
            case IconType.LOADING_ICON:
                base64_string = self._assets_loading_icon
            
        img: wx.svg.SVGimage = wx.svg.SVGimage.CreateFromBytes(BytesIO(base64.b64decode(base64_string)).getvalue())

        size = self._get_icon_scale_and_size()

        sx = size.width / img.width
        sy = size.height / img.height

        scale = min(sx, sy)
        
        return img.ConvertToBitmap(scale = scale, width = size.width, height = size.height)

    def _get_icon_scale_and_size(self):
        if self.DPI_scale_factor <= self.DPI_factor_1:
            return wx.Size(16, 16)

        elif self.DPI_scale_factor <= self.DPI_factor_1_5:
            return wx.Size(24, 24)

        else:
            return wx.Size(32, 32)

    @property
    def _assets_app_icon_default(self):
        base64_string = ""

        return wx.Image(BytesIO(base64.b64decode(base64_string)))

    @property
    def _assets_app_icon_small(self):
        base64_string = ""

        return wx.Image(BytesIO(base64.b64decode(base64_string))).ConvertToBitmap()

    @property
    def _assets_resume_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_pause_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_delete_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_folder_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_retry_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_refresh_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_setting_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_list_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property 
    def _assets_info_icon(self):
        if self.dark_mode:
            return ""
        else:
            return ""

    @property
    def _assets_loading_icon(self):
        if self.dark_mode:
            return ""
